import React from 'react';
import "../App.css"
import Button from '@material-ui/core/Button';
import { Container, CssBaseline, Typography } from '@material-ui/core';



function Chat({ name, message }) {

       return (
              <React.Fragment>
                     <CssBaseline />
                     <Container fixed>
                            <h1>  Hello Guys </h1>

                            <Typography component="div" style={{ backgroundColor: '#cfe8fc', height: '50vh', width: '50vh' }} />

                     </Container>
              </React.Fragment>
       );
}
export default Chat;
